rcollate = function(list) {
  var line, out;
  out = "";
  while (list.length > 2) {
    line = list.shift();
    out += line + ", ";
  }
  if (list.length > 1) {
    out += list[0] + " and " + list[1];
  } else {
    return list[0];
  }
  return out;
};

