  app(newdiv, mk('br'));
  app(newdiv, txt("Select the sources you wish to add to this view below:"));
  app(newdiv, mk('br'));
  btn = mk('input');
  set(btn, 'type', 'button');
  set(btn, 'class', 'btn btn-danger');
  set(btn, 'value', 'Save view');
  set(btn, 'onclick', 'saveview();');
